import React from 'react';

class Shortcut extends React.Component{
  render(){
    return (
      <div>        
        <p class="shortcut">{this.props.sales}</p>
        <p style={{textAlign: "center"}}>{this.props.menus}</p>
        <p style={{textAlign: "center"}}>{this.props.extras}</p>
        <p style={{textAlign: "center"}}>{this.props.delivery}</p>
      </div>
    );
  }
}

export default Shortcut;
